package main

import (
	"fmt"
	"math"
)

func main() {

	output := react(input, 0)
	fmt.Println(len(output))

	var min int
	var minE byte
	min = math.MaxInt64
	for _, e := range []byte("abcdefghijklmnopqrstuvwxyz") {
		output := react(input, e)
		if len(output) < min {
			min = len(output)
			minE = e
		}
	}

	fmt.Println(min, string(minE))
}

func react(input []byte, exclude byte) []byte {
	output := make([]byte, 0, len(input))
	for _, c := range input {
		if c == exclude || c == exclude-'a'+'A' {
			continue
		}
		if len(output) > 0 {
			a, b := c, output[len(output)-1]
			if b < a {
				a, b = b, a
			}
			if b == a-'A'+'a' {
				output = output[:len(output)-1]
				continue
			}
		}
		output = append(output, c)
	}

	return output
}

var input = []byte("")
